import React from 'react';

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Checkbox from '@mui/'

export default function UsersTable() {
    const data = [
        {
            name: 'Damian Bond',
            email: 'damian@damian.pl',
            position: 'Back-end Developer',
            department: 'Dział IT',
            organization: 'Ostendi Global',
            date: '04.04.2022',
            status: 1
        },
        {
            name: 'Damian Bond',
            email: 'damian@damian.pl',
            position: 'Back-end Developer',
            department: 'Dział IT',
            organization: 'Ostendi Global',
            date: '04.04.2022',
            status: 1
        },
        {
            name: 'Damian Bond',
            email: 'damian@damian.pl',
            position: 'Back-end Developer',
            department: 'Dział IT',
            organization: 'Ostendi Global',
            date: '04.04.2022',
            status: 1
        },
    ];

    return (
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 650 }} aria-label="simple table">
                <TableHead>
                <TableRow>
                    <TableCell></TableCell>
                    <TableCell>Imię i nazwisko</TableCell>
                    <TableCell align="right">Email</TableCell>
                    <TableCell align="right">Nazwa stanowiska</TableCell>
                    <TableCell align="right">Pion / Dział</TableCell>
                    <TableCell align="right">Jednostka organizacyjna</TableCell>
                    <TableCell align="right">Data modyfikacji</TableCell>
                    <TableCell align="right">Status</TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
                    {data.map(({name, email, position, department, organization, date, status}) => (
                        <TableRow
                            key={name}
                            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                        >
                            <TableCell component="th" scope="row">
                                {name}
                            </TableCell>
                            <TableCell align="right">{email}</TableCell>
                            <TableCell align="right">{position}</TableCell>
                            <TableCell align="right">{department}</TableCell>
                            <TableCell align="right">{organization}</TableCell>
                            <TableCell align="right">{date}</TableCell>
                            <TableCell align="right">{status}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    )
}
